import React from "react";
import "./education.css";

function Education() {
  return (
    <div className="card">
      <img
        src="https://via.placeholder.com/150"
        alt="Avatar"
        style={{ width: '100%' }}
      />
      <div className="container">
        <div className="education">
          <h4 className="title">
            <b>Bachillerato:</b> Gestión y Administración Empresarial
          </h4>
          <p className="institution">Universidad: Técnica Nacional</p>
        </div>
        <div className="education">
          <h4 className="title">
            <b>Título:</b> Técnico en Secretariado Ejecutivo
          </h4>
          <p className="institution">Institución: CTP Ricardo Castro Beer</p>
        </div>
      </div>
    </div>
  );
}

export default Education;
